import { Button, Input } from "antd";
import React, { useState } from "react";
import { useHistory } from "react-router-dom";

const Login = () => {
    let history = useHistory();
    const [Email , setEmail] = useState('');
    const [Password , setPassword] = useState('');
    const [tab,selectTab] = useState('login')
return(
    <div>
        <div>
        <div onClick={() => selectTab('login')}>Login</div>
        <div onClick={() => selectTab('signup')}>Signup</div>
        </div>
       
        <span>Email</span> <Input value={Email} onChange={(event) => {
            setEmail(event.target.value);
        }} />
        <span>Password</span> <Input.Password value={Password} onChange={(event) => setPassword(event.target.value)} sec />
        <div>{Email}</div>
        <div>{Password}</div>
        <Button onClick={() => history.push('/admin')}>{tab === 'login' ? 'Login': 'Signup'}</Button>
    </div>
)
};

export default Login;
